import React from "react";

import HealthMainText from "../components/Health/HealthMainText";

import drinkingMatchaImg from "../images/matchaGirl.png";


import styles from "./HealthPage.module.css";

const HealthPage = () => {
  return (
    <div className={styles.container}>
      <div className={styles.header}>
        <HealthMainText />
      </div>
      <div className={styles.body}>
        <div className={styles.image}>
          <img src={drinkingMatchaImg}></img>
        </div>
      </div>
      <div className={styles.bubbles}>
        <img
          src={pin}
          className={`${styles.pin} ${styles.pin__1}`}
          onMouseEnter={() => showModalHandler("Uji")}
        ></img>
        <img
          src={pin}
          className={`${styles.pin} ${styles.pin__2}`}
          onMouseEnter={() => showModalHandler("Fukuoka")}
        ></img>
        <img
          src={pin}
          className={`${styles.pin} ${styles.pin__3}`}
          onMouseEnter={() => showModalHandler("Nishio")}
        ></img>
      </div>
    </div>
  );
};

export default HealthPage;
